import { HttpClient } from '@angular/common/http';
import { Component } from '@angular/core';

@Component({
  selector: 'app-eventos',
  templateUrl: './eventos.component.html',
  styleUrls: ['./eventos.component.scss']
})
export class EventosComponent {

  Eventos: any = [];
  EventosFiltrados: any = [];
  renderImage: boolean = false
  private _filtroLista:  string = '';

  public get filtroLista(){


    return this._filtroLista;
  }

  public set filtroLista(value: string){
    this._filtroLista = value;
    this.EventosFiltrados = this._filtroLista ? this.filtrarEventos(this.filtroLista) : this.Eventos
  }


  filtrarEventos(filtraPor: string ): any{
    filtraPor  = filtraPor.toLocaleLowerCase();
    return this.Eventos.filter(
      (evento: any) => evento.tema.toLocaleLowerCase().indexOf(filtraPor) !== -1
    )
  }
  constructor(private http: HttpClient){}

  ngOnInit(): void{
    this.getEventos();
    this.renderImageFunction();
  }

  public getEventos(): void{
    this.http.get('https://localhost:5001/Evento').subscribe(
      response => {
        this.Eventos = response,
        this.EventosFiltrados = response
      },
      error => console.log(error)
    )

  }

  public renderImageFunction(): void{
    this.renderImage = !this.renderImage;
  }
}
<h2>Eventos</h2>
<hr>

<div class="form-inline">
  <div class="form-group  mb-2">
    <label for="mr-2">Filtro</label>
    <input
    type="text"
    class="form-control mr-2"
    placeholder="Buscar"
    [(ngModel)]="filtroLista">
  </div>

<h3>Filtro: {{filtroLista}}</h3>
<table class="table table-striped">
  <thead class="bg-dark">
    <tr>
      <th>
        <button class="btn btn-outline-dark" (click)="renderImageFunction()">
          {{renderImage ? 'Esconder'  : 'Mostrar'}}
        </button>
      </th>
      <th>#</th>
      <th>Tema</th>
      <th>Local</th>
      <th>Data</th>
      <th>Quantidade de pessoas</th>
      <th>Lote</th>
      <th>Opçoes</th>
    </tr>
  </thead>
  <tbody *ngIf="Eventos && Eventos.length">
    <tr *ngFor="let item of EventosFiltrados" >
      <td><img *ngIf="renderImage"  width="200px" src="{{item.imageUrl}}" alt="">  </td>
      <td>{{item.eventoId}}</td>
      <td>{{item.tema}}</td>
      <td>{{item.local}}</td>
      <td>{{item.dataEvento}}</td>
      <td>{{item.qtdPessoas}}</td>
      <td>{{item.lote}}</td>
      <td>{{item.opcoes}}</td>
      <td>
        <button type="button" class="btn btn-primary btn-sm">Small button</button>
        <button type="button" class="btn btn-secondary btn-sm">Small button</button>
      </td>
    </tr>
  </tbody>
  <tfoot *ngIf="!Eventos.length">
    <tr>
      <td colspan="8" class="text-center">
        <h4>Nenhum evento encontrado!</h4>
      </td>
    </tr>
  </tfoot>
</table>
